\quad 
\begin {prooftree}
    \hypo {\Gamma  \vdash  t : A_1 \times  A_2}
    \infer 1[intro $i \in  \{1, 2\}$]{\pr _i(t) : A_i}
\end {prooftree}

\begin {prooftree}
